webpackJsonp([22914968716344],{3238:function(e,t){e.exports={pathContext:{docHtml:'<h1>timed-out <a href="https://travis-ci.org/floatdrop/timed-out"><img src="https://travis-ci.org/floatdrop/timed-out.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Timeout HTTP/HTTPS requests</p>\n</blockquote>\n<p>Emit Error object with <code>code</code> property equal <code>ETIMEDOUT</code> or <code>ESOCKETTIMEDOUT</code> when ClientRequest is hanged.</p>\n<h2>Usage</h2>\n<pre><code class="language-js">var get = require(\'http\').get;\nvar timeout = require(\'timed-out\');\n\nvar req = get(\'http://www.google.ru\');\ntimeout(req, 2000); // Set 2 seconds limit\n</code></pre>\n<h3>API</h3>\n<h4>timedout(request, time)</h4>\n<h5>request</h5>\n<p><em>Required</em><br>\nType: <a href="http://nodejs.org/api/http.html#http_class_http_clientrequest"><code>ClientRequest</code></a></p>\n<p>The request to watch on.</p>\n<h5>time</h5>\n<p><em>Required</em><br>\nType: <code>number</code> or <code>object</code></p>\n<p>Time in milliseconds to wait for <code>connect</code> event on socket and also time to wait on inactive socket.</p>\n<p>Or you can pass Object with following fields:</p>\n<ul>\n<li><code>connect</code> - time to wait for connection</li>\n<li><code>socket</code>  - time to wait for activity on socket</li>\n</ul>\n<h2>License</h2>\n<p>MIT Â© <a href="floatdrop@gmail.com">Vsevolod Strukchinsky</a></p>',docPath:"argo-ci/node_modules/timed-out/readme",proj:"argo-ci"}}}});
